function AOBRep(search, change)
	local aob = AOBScan(search)
	if aob then
		for i=0,aob.Count-1 do
			autoAssemble(aob[i]..':\ndb '..change)
		end
		aob.Destroy()
	end
end

function RepAob(search, replace)
local aob = AOBScan(search)
if aob then
  for i=0,aob.Count-1 do
    autoAssemble(aob[i]..':\ndb '..replace)
  end
  aob.Destroy()
  return true
else
  return false
end
end

